-- ----------------------------
-- View structure for `view_backlog`
-- ----------------------------
DROP VIEW IF EXISTS `view_backlog`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_backlog` AS select `a`.`bl_id` AS `blId`,`a`.`bl_content` AS `blContent`,`a`.`bl_level` AS `blLevel`,`a`.`start_date` AS `startDate`,`a`.`fnsh_date` AS `fnshDate`,`a`.`expire_date` AS `expireDate`,`a`.`bl_status` AS `blStatus`,`a`.`bl_mes` AS `blMes`,`a`.`bl_des` AS `blDes`,`a`.`bl_issue_user` AS `blIssueUser`,`a`.`bl_exe_user` AS `blExeUser`,`a`.`alarm_days` AS `alarmDays`,`a`.`create_date` AS `createDate`,(`a`.`expire_date` - interval `a`.`alarm_days` day) AS `alarmDate`,(case when (`a`.`bl_status` = '-1') then '删除' when (`a`.`bl_status` = '0') then '完成' when (timestampdiff(DAY,`a`.`expire_date`,now()) > 0) then '过期' when (timestampdiff(DAY,`a`.`expire_date`,now()) > (0 - `a`.`alarm_days`)) then '预警' else '正常' end) AS `expireStatus`,timestampdiff(DAY,now(),`a`.`expire_date`) AS `expireDays`,`a`.`bl_classify` AS `blClassify`,`dic`.`dic_name` AS `blClassifyName`,`a`.`bl_sys` AS `blSys` from (`backlog_info` `a` left join `sys_dic_pub` `dic` on((`a`.`bl_classify` = `dic`.`dic_id`)));

-- ----------------------------
-- View structure for `view_proc_user`
-- ----------------------------
DROP VIEW IF EXISTS `view_proc_user`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_proc_user` AS select `proc_task`.`jobno` AS `jobno`,`proc_task`.`assigner` AS `user_id`,'assigner' AS `proc_role` from `se_proc_task` `proc_task` union select `proc_performer`.`jobno` AS `jobno`,`proc_performer`.`user_id` AS `user_id`,'performer' AS `proc_role` from `se_proc_performer` `proc_performer`;

-- ----------------------------
-- View structure for `view_project_user`
-- ----------------------------
DROP VIEW IF EXISTS `view_project_user`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_project_user` AS select `p`.`project_id` AS `projectId`,`p`.`pro_name` AS `projectName`,`u`.`user_id` AS `userId`,`u`.`user_name` AS `userName`,`lv`.`dic_id` AS `lvId`,`lv`.`dic_name` AS `lvName`,`pos`.`dic_id` AS `posId`,`pos`.`dic_name` AS `posName` from ((((`se_project_info` `p` left join `se_map_project_user` `pu` on((`p`.`project_id` = `pu`.`project_id`))) left join `se_user` `u` on((`pu`.`user_id` = `u`.`user_id`))) left join `sys_dic_pub` `lv` on((`pu`.`user_level` = `lv`.`dic_id`))) left join `sys_dic_pub` `pos` on((`pu`.`user_pos` = `pos`.`dic_id`))) where (`u`.`user_id` is not null);

-- ----------------------------
-- View structure for `view_todo_list`
-- ----------------------------
DROP VIEW IF EXISTS `view_todo_list`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_todo_list` AS select distinct `ins`.`BUSINESS_KEY_` AS `BUSSINESSKEY`,`task`.`ID_` AS `TASKID`,`task`.`EXECUTION_ID_` AS `EXECUTIONID`,`task`.`PROC_INST_ID_` AS `PROCINSID`,`task`.`PROC_DEF_ID_` AS `PROCDEFID`,`task`.`NAME_` AS `TASKNAME`,`task`.`TASK_DEF_KEY_` AS `TASKDEFKEY`,`task`.`CREATE_TIME_` AS `TASKCREATETIME`,`task`.`FORM_KEY_` AS `FORMKEY`,'assignee' AS `ASSIGNTYPE`,`task`.`ASSIGNEE_` AS `TASKUSERID`,`step`.`step_code` AS `STEPCODE` from (((`act_ru_task` `task` left join `act_re_procdef` `d` on((`task`.`PROC_DEF_ID_` = `d`.`ID_`))) left join `act_hi_procinst` `ins` on((`task`.`PROC_INST_ID_` = `ins`.`ID_`))) left join `sys_dic_process_step` `step` on((`task`.`TASK_DEF_KEY_` = `step`.`step_code`))) where ((`task`.`ASSIGNEE_` is not null) and (`task`.`SUSPENSION_STATE_` = '1')) union select distinct `ins`.`BUSINESS_KEY_` AS `BUSSINESSKEY`,`task`.`ID_` AS `TASKID`,`task`.`EXECUTION_ID_` AS `EXECUTIONID`,`task`.`PROC_INST_ID_` AS `PROCINSID`,`task`.`PROC_DEF_ID_` AS `PROCDEFID`,`task`.`NAME_` AS `TASKNAME`,`task`.`TASK_DEF_KEY_` AS `TASKDEFKEY`,`task`.`CREATE_TIME_` AS `TASKCREATETIME`,`task`.`FORM_KEY_` AS `FORMKEY`,`i`.`TYPE_` AS `ASSIGNTYPE`,`i`.`USER_ID_` AS `TASKUSERID`,`step`.`step_code` AS `STEPCODE` from (((((`act_ru_task` `task` left join `act_re_procdef` `d` on((`task`.`PROC_DEF_ID_` = `d`.`ID_`))) left join `act_ru_variable` `v` on((`v`.`PROC_INST_ID_` = `task`.`PROC_INST_ID_`))) left join `act_ru_identitylink` `i` on((`i`.`TASK_ID_` = `task`.`ID_`))) left join `act_hi_procinst` `ins` on((`task`.`PROC_INST_ID_` = `ins`.`ID_`))) left join `sys_dic_process_step` `step` on((`task`.`TASK_DEF_KEY_` = `step`.`step_code`))) where (isnull(`task`.`ASSIGNEE_`) and (`i`.`TYPE_` = 'candidate') and (`task`.`SUSPENSION_STATE_` = '1'));

-- ----------------------------
-- View structure for `view_trace_task_union`
-- ----------------------------
DROP VIEW IF EXISTS `view_trace_task_union`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_trace_task_union` AS select `trace`.`trace_id` AS `id`,`trace`.`trace_name` AS `name`,`trace`.`parent_id` AS `parentId`,`trace`.`project_id` AS `projectId`,'1' AS `isParent`,'trace' AS `dataType` from `se_requirement_trace` `trace` where (`trace`.`is_delete` = '1') union select `task`.`task_id` AS `id`,`task`.`task_title` AS `name`,`task`.`trace_id` AS `parentId`,`ptrace`.`project_id` AS `projectId`,'0' AS `isParent`,'task' AS `dataType` from (`se_trace_task` `task` left join `se_requirement_trace` `ptrace` on((`task`.`trace_id` = `ptrace`.`trace_id`)));

-- ----------------------------
-- View structure for `view_user_auth`
-- ----------------------------
DROP VIEW IF EXISTS `view_user_auth`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_user_auth` AS select `urm`.`user_id` AS `userId`,`urm`.`role_code` AS `roleCode`,`urm`.`project_id` AS `projectId`,`ram`.`auth_code` AS `authCode` from (`se_map_user_role` `urm` left join `se_map_role_auth` `ram` on((`urm`.`role_code` = `ram`.`role_code`)));

-- ----------------------------
-- View structure for `view_user_menu`
-- ----------------------------
DROP VIEW IF EXISTS `view_user_menu`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_user_menu` AS select distinct `mur`.`user_id` AS `userId`,`m`.`menu_id` AS `menuId`,`m`.`menu_name` AS `menuName`,`m`.`menu_name_en` AS `menuNameEn`,`m`.`menu_url` AS `menuUrl`,`m`.`menu_ico` AS `menuIco`,`m`.`open_type` AS `openType`,`m`.`tree_code` AS `treeCode`,`m`.`menu_order` AS `menuOrder`,`m`.`is_leaf` AS `isLeaf` from ((`se_map_user_role` `mur` left join `se_map_role_menu` `mrm` on((`mur`.`role_code` = `mrm`.`role_code`))) left join `se_menu` `m` on((`mrm`.`menu_id` = `m`.`menu_id`)));

-- ----------------------------
-- View structure for `view_user_workload_of_day`
-- ----------------------------
DROP VIEW IF EXISTS `view_user_workload_of_day`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_user_workload_of_day` AS select `lg`.`user_id` AS `userId`,`lg`.`plog_date` AS `plogDate`,sum(`lg`.`plog_workload`) AS `sumWorkload` from `se_person_log` `lg` where (`lg`.`is_delete` = '1') group by `lg`.`user_id`,`lg`.`plog_date` order by `lg`.`user_id`,`lg`.`plog_date`;

-- ----------------------------
-- View structure for `v_se_trace_value`
-- ----------------------------
DROP VIEW IF EXISTS `v_se_trace_value`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_se_trace_value` AS select `s`.`vid` AS `vid`,`s`.`trace_id` AS `trace_id`,`s`.`kcode` AS `kcode`,`s`.`ktype` AS `ktype`,`s`.`v` AS `v` from `se_trace_value_string` `s` union select `t`.`vid` AS `vid`,`t`.`trace_id` AS `trace_id`,`t`.`kcode` AS `kcode`,`t`.`ktype` AS `ktype`,`t`.`v` AS `v` from `se_trace_value_text` `t`;

-- ----------------------------
-- View structure for `xxjt_view_bzxk`
-- ----------------------------
DROP VIEW IF EXISTS `xxjt_view_bzxk`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `xxjt_view_bzxk` AS select `gj`.`bzmc` AS `gjbz`,`hj`.`bzmc` AS `fsbz`,`bzkz`.`zy` AS `jc` from ((`xxjt_bzkz` `bzkz` left join `xxjt_bz` `gj` on((`bzkz`.`gj` = `gj`.`gj`))) left join `xxjt_bz` `hj` on((`bzkz`.`hj` = `hj`.`hj`))) order by `hj`.`bzmc`,`bzkz`.`zy` desc;
