INSERT INTO `checklist` VALUES ('1a', 'root', null, '检查项目表0', '检查项目表', '检查项目表', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35980a64d015980d0269b0001', 'root.00002.00002.00002.00003', '40283f81595fd23b01595fefa888001d', '依赖注入规范', '', '<p>如引入DAO则使用@Resource引入，不在SPRING的配置文件中进行配置注入</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35980a64d015980d32fe30002', 'root.00002.00002.00001.00006', '40283f81595fd23b01595fea02af000d', '调用Service规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>为保持事务的一致性，Controller中的对数据库多次删、改、增操作要写到Dubbo服务中的同一个方法中，不允许调用多个Dubbo服务或方法。<br/></p></li><li><p>Controller中不允许出现SQL语句</p></li><li><p>Controller中处理http请求必须要加入try,catch语句，如catch到异常，必须处理后返回前端，不允许将报错的SQL语句、空指针等内容直接输送到前端进行展示</p><p><br/></p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35980a64d015980d6ab600003', 'root.00002.00002.00006', '40283f81595fd23b01595fe9e99e000c', 'Dao规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35980a64d015980d706dc0004', 'root.00002.00002.00006.00001', '2c9a40b35980a64d015980d6ab600003', '命名规范', '', '<p>每个表应该各自的DAO，命名使用驼峰式命名方式，例如BS_SYS_USER -&gt; 接口：BsSysUserDao.java 实现：BsSysUserDaoImpl.java</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35980a64d015980d884d90005', 'root.00002.00002.00006.00002', '2c9a40b35980a64d015980d6ab600003', '继承公共DAO规范', '', '<p style=\"text-align: left;\">所有DAO接口实现类必须继承公共Dao实现类并实现其自己的DAO接口<br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35980a64d015981c43fa90008', 'root.00002.00001.00001.00010', '40283f81595fd23b01595fea2231000e', '国际化规范', '', '<p>1.国际化在开发阶段完成，按照原型上内容，中英文保持一致，但必须要进行国际化，后期将国际化文件发给业务处室进行统一翻译。</p><p>2.公共国际化内容不允许重名定义！参见common_en.properties、common_zh_CN.properties</p><p><br/></p><p>检查方法：检查页面中查询、重置、新增、编辑等按钮是否使用了common_en.properties中的配置文件</p><p><br/></p><p>检查方法：</p><p>把common_en.properties、common_zh_CN.properties等要检查文件的内容粘到EXCEl中，处理过后导入临时数据表，使用如下sql语句进行检查</p><p>select value from aaa where type =1 &nbsp;intersect &nbsp;select value from aaa b where b.type=0 &nbsp;</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35980a64d0159826cf8360009', 'root.00002.00002.00002.00004', '40283f81595fd23b01595fefa888001d', '服务层事务规范', '', '<p>带有删、改、新增的工作要保证数据库事务的一致性，同一方法内如对数据库进行多次非查询操作不允许使用catch通过程序处理异常，catch后必须继续抛出异常，在controller中统一进行处理<br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359902bfd015990a7685c004d', 'root.00002.00002.00001.00007', '40283f81595fd23b01595fea02af000d', '非String类型字段保存规范', '非String类型字段保存规范', '<p>场景：编辑非String类型数据，原始数据中有值，清空后保存。</p><p>对于保存非String类型的字段数据，如果使用BaseDao中public void update(Object original,Serializable id,Object[] nullProperties)方法时，要将非String类型字段对应的POJO属性名称放在nullProperties参数中，否则保存不上！</p><p><br/></p><p>检查方法：查询更新操作是否能将非字符串的内容清空后保存到数据库中。</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996b3aa070003', 'root.00004', '1a', '交叉测试规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996b3d37b0004', 'root.00004.00001', '2c9a40b3599542fb015996b3aa070003', '功能满足需求规格、设计说明书', '', '', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996b43ee60005', 'root.00004.00002', '2c9a40b3599542fb015996b3aa070003', '生成的32位主键不允许可见', '', '<p>32位自动生成主键不允许出现到页面任何可见位置</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996b67f7d0006', 'root.00002.00001.00001.00011', '40283f81595fd23b01595fea2231000e', '前台数据展示规范', '前台数据展示规范', '<p>前台展示的数据，如果数据源为用户输入的内容（包括从数据库中查出的用户曾输入的内容），需要使用&lt;c:out&gt;标签进行输出，不允许使用${}进行输出（放置用户输入的&quot;&gt;等内容直接输出到JSP中导致页面错乱现象发生）。</p><p><br/></p><p>检查方法：ctrl+f 检索&quot;${&quot;字符串，查看匹配的地方是否需要使用&lt;c:out&gt;</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996ba526e0007', 'root.00004.00003', '2c9a40b3599542fb015996b3aa070003', '非字符串类型保存规范', '', '<p>带有非字符串（数字，日期）的编辑界面，清空后保存，数据保存正常</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996bb8e690008', 'root.00004.00004', '2c9a40b3599542fb015996b3aa070003', '界面美观', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>不允许出现不必要的滚动条</p></li><li><p>界面布局整体大方<br/></p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996bc63450009', 'root.00004.00005', '2c9a40b3599542fb015996b3aa070003', '满足详细设计要求', '', '', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996bd3f72000a', 'root.00004.00006', '2c9a40b3599542fb015996b3aa070003', '不允许出现404、500错误', '', '', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996c998a4000b', 'root.00004.00007', '2c9a40b3599542fb015996b3aa070003', '页面国际化', '', '', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb015996d1f23d000c', 'root.00004.00008', '2c9a40b3599542fb015996b3aa070003', '图标操作按钮必须有提示', '', '<p>对于只有图标没有文字的操作按钮或链接，必须加入鼠标经过时提示功能</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b3599542fb01599727ea2f0010', 'root.00004.00009', '2c9a40b3599542fb015996b3aa070003', '所有删除按钮点击后要确认', '', '', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a527fe0159a555abb8000d', 'root.00002.00003.00004', '40283f81595fd23b01595ff331b50023', 'try catch语句规范', '', '<p>try{</p><p>&nbsp; ....</p><p>}catch(Exception e){</p><p>&nbsp;e.printStackTrace();</p><p>&nbsp;</p><p>}&nbsp;</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a527fe0159a556e42f000e', 'root.00002.00003.00005', '40283f81595fd23b01595ff331b50023', '代码缩进', '', '<p>注意代码缩进</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a527fe0159a5f753780028', 'root.00002.00003.00006', '40283f81595fd23b01595ff331b50023', '语句块用大括号括起来', '', '<p>if,for,while,try catch,等带有语句块的语法，语句块要使用大括号，不允许一行语句块省略大括号。例如：</p><p>正确的写法：</p><p>if(a == 1){</p><p>&nbsp; System.out.println(1)</p><p>}</p><p><br/></p><p>错误的写法：</p><p>if(a == 1)</p><p>System.out.println(1)</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a527fe0159a67e4dec0043', 'root.00002.00002.00005.00004', '40283f81595fd23b01595ff499250027', '非查询的DB操作使用Hibernate', '', '<p>为了记录数据变化日志，非查询的DB操作使用Hibernate。</p><p>检查方法：</p><p>ctrl+h 查询</p><p>&quot;delete</p><p>&quot; delte</p><p>&quot;update</p><p>&quot; update</p><p>&quot;insert</p><p>&quot; insert</p><p>关系表可使用先全用SQL删后使用hibernate插入的操作（如离线版需要数据则例外，必须记录删除状态）</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a527fe0159a6912b730045', 'root.00002.00003.00007', '40283f81595fd23b01595ff331b50023', '公共字段时间格式', '', '<p>&nbsp;所有表的cre_time和mod_time时间格式都是日期+时分秒的格式&nbsp;&nbsp;&nbsp;如果有这两个字段则不能为空&nbsp;</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a9f5aa0159aa05b7010001', 'root.00002.00004', '40283f81595fd23b01595fe95378000a', '基础功能测试', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a9f5aa0159aa05ec9b0002', 'root.00002.00004.00001', '2c9a40b359a9f5aa0159aa05b7010001', '404|505规范', '', '<p>页面不允许出现点击后显示404 或 500的错误页面。</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a9f5aa0159aa069d530003', 'root.00002.00004.00002', '2c9a40b359a9f5aa0159aa05b7010001', '关闭按钮', '', '<p>所有关闭按钮点击后关闭页面</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a9f5aa0159aa06eb610004', 'root.00002.00004.00003', '2c9a40b359a9f5aa0159aa05b7010001', '32位ID不允许出现在页面中', '', '<p>32为ID不允许出现在页面中</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a9f5aa0159aa076bf70005', 'root.00002.00004.00004', '2c9a40b359a9f5aa0159aa05b7010001', '页面不存在明显错误', '', '<p>页面中不允许出现明显的错误，包括布局，报错，文字错误</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a9f5aa0159aa5907430035', 'root.00002.00002.00007', '40283f81595fd23b01595fe9e99e000c', 'POJO规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a9f5aa0159aa592b820036', 'root.00002.00002.00007.00001', '2c9a40b359a9f5aa0159aa5907430035', '生成方式', '', '<p>均采用注释的方式<br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a9f5aa0159aa59c1dd0037', 'root.00002.00002.00007.00002', '2c9a40b359a9f5aa0159aa5907430035', '不建立外键关联', '', '<p>POJO不建立一对一，一对多等关系</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b359a9f5aa0159aa5a13c90038', 'root.00002.00002.00007.00003', '2c9a40b359a9f5aa0159aa5907430035', '时间字段处理', '', '<p>对于创建时间(CRE_TIME)和修改时间(MOD_TIME)，保存到数据库中应为&quot;yyyy-MM-dd HH:mm:ss&quot;格式，POJO的写法应为：</p><p>@DateTimeFormat(pattern = &quot;yyyy-MM-dd HH:mm:ss&quot;)&nbsp;</p><p>private java.util.Date modTime;</p><p><br/></p><p>@Temporal(TemporalType.TIMESTAMP)</p><p>@Column(name = &quot;MOD_TIME&quot;)</p><p>public java.util.Date getModTime(){</p><p>&nbsp; &nbsp; return this.modTime;</p><p>}</p><p><br/></p>', '1', '1', '1');
