left-width: 1px; border-right-color: black; border-bottom-color: black; border-left-color: black; border-top: none; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">成组收费</span></p></td><td width=\"435\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: black; border-right-width: 1px; border-right-color: black; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">/ssmis2015file<span style=\"color:red\">/sys/cz/</span><span style=\"color:#7030A0\">[</span></span><span style=\"font-size:12px;line-height:150%;color:#7030A0\">随机数].[后缀]</span></p></td></tr><tr><td width=\"92\" colspan=\"2\" valign=\"top\" style=\"border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-right-color: black; border-bottom-color: black; border-left-color: black; border-top: none; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">组件管理</span></p></td><td width=\"435\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: black; border-right-width: 1px; border-right-color: black; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">/ssmis2015file<span style=\"color:red\">/sys/component/</span><span style=\"color:#7030A0\">[</span></span><span style=\"font-size:12px;line-height:150%;color:#7030A0\">随机数].[后缀]</span></p></td></tr><tr><td width=\"92\" colspan=\"2\" valign=\"top\" style=\"border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-right-color: black; border-bottom-color: black; border-left-color: black; border-top: none; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">文本编辑器</span></p></td><td width=\"435\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: 