INSERT INTO `checklist` VALUES ('2c9a40b35a15fe98015a1625c4f90007', 'root.00002.00001.00002.00001', '2c9a40b35a15fe98015a1624f6e30006', '文件上传目录', '文件上传目录要求', '<table cellspacing=\"0\" cellpadding=\"0\" data-sort=\"sortDisabled\"><tbody><tr class=\"firstRow\"><td width=\"92\" colspan=\"2\" valign=\"top\" style=\"border-width: 1px; border-color: black; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">模块</span></p></td><td width=\"435\" valign=\"top\" style=\"border-top-width: 1px; border-right-width: 1px; border-bottom-width: 1px; border-top-color: black; border-right-color: black; border-bottom-color: black; border-left: none; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">目录</span></p></td></tr><tr><td width=\"92\" colspan=\"2\" valign=\"top\" style=\"border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-right-color: black; border-bottom-color: black; border-left-color: black; border-top: none; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">用户签名</span></p></td><td width=\"435\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: black; border-right-width: 1px; border-right-color: black; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">/ssmis2015file<span style=\"color:red\">/user/sign/</span><span style=\"color:#7030A0\">[usercode]_[</span></span><span style=\"font-size:12px;line-height:150%;color:#7030A0\">时间戳].[后缀]</span></p></td></tr><tr><td width=\"92\" colspan=\"2\" valign=\"top\" style=\"border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-right-color: black; border-bottom-color: black; border-left-color: black; border-top: none; padding: 0px 7px;\"><p style=\"text-indent:0\"><span style=\"font-size:12px;line-height:150%\">FORM</span><span style=\"font-size:12px;lin