ght=\"19\" style=\"word-break: break-all;\">1</td><td height=\"19\" style=\"word-break: break-all;\">2</td><td height=\"19\" style=\"word-break: break-all;\">3</td></tr><tr><td height=\"19\" style=\"word-break: break-all;\">1</td><td height=\"19\" style=\"word-break: break-all;\">2</td><td height=\"19\" style=\"word-break: break-all;\">3</td></tr></tbody></table><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35a15fe98015a16261fc20008', 'root.00002.00001.00002.00002', '2c9a40b35a15fe98015a1624f6e30006', '文件上传调用公共接口', '文件上传调用公共接口', '<p>文件上传调用公共接口BsSysFileUploadService，<span style=\"color: rgb(255, 0, 0);\">且必须在前端调用</span>！！！！</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35a461b7a015a497a54bb0007', 'root.00002.00001.00001.00012', '40283f81595fd23b01595fea2231000e', '数据列表规范', '数据列表规范', '<p>从列表进入编辑页，如果是弹出的方式，编辑后自动刷新列表，且保持当前查询条件和页数</p><p>删除操作后同样自动刷新列表，且保持当前查询条件和页数</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35a5e21fa015a5fd472720023', 'root.00004.00010', '2c9a40b3599542fb015996b3aa070003', '输入数据项校验', '输入数据项校验', '<p>可输入文本的数据项必须校验长度，测试字符串 [&quot;&#39;&gt;/&gt;&lt;div &lt;div&gt;] 可正常进行保存,且显示正常</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35ab08568015ab26a75b30004', 'root.00002.00001.00001.00013', '40283f81595fd23b01595fea2231000e', '表单验证', '', '<p>所有可输入的表单都需要进行校验，使用formvalidation插件，对于数字的需要校验是否数字及长度、是否可空，字符串需验证长度（数据库长度除以3取整数）、是否可空。日期类型是否可空，日期格式。下拉，radio,checkbox验证是否可空</p><p><br/></p><p>日期输入格式统一为YYYY-MM-DD，如果业务需要带时间则为hh:mm:dd</p><p><br/></p><p><br/></p><p>注意事项：1.select2下拉不可编辑时不要添加长度验证事件</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35aef8f77015aef8fffaf0001', 'root.00002.00002.00008', '40283f81595fd23b01595fe9e99e000c', 'Dubbo服务规范', 'Dubbo服务规范', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35aef8f77015aef90b46e0002', 'root.00002.00002.00008.00001', '2c9a40b35aef8f77015aef8fffaf0001', 'Dubbo服务只能调用Service层', 'Dubbo服务只能调用Service层', '<p>Dubbo服务层只能调用Service层，不允许直接调用Dao层，且Dubbo层之间不允许相互调用</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35aef8f77015aef9327870003', 'root.00002.00002.00008.00002', '2c9a40b35aef8f77015aef8fffaf0001', 'Dubbo层服务才可暴露给前端', 'Dubbo层服务才可暴露给前端', '<p>Dubbo层服务放到com.ccs.ssmis.[子系统名称].biz包下。</p><p>Dubbo层服务才可暴露给前端，不允许Service层直接注册到Dubbo中。</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35aef8f77015aef97f2e90004', 'root.00002.00002.00008.00003', '2c9a40b35aef8f77015aef8fffaf0001', 'Dubbo服务名称规范', 'Dubbo服务名称规范', '<p>所有Dubbo层注册的接口及接口下的方法都必须与《组件接口文档》保持一致</p><p>文档位置:SVN &nbsp;http://10.1.1.31/ssmis2015/ssmis2015/10 A6建造子系统/06 设计文档/组件接口设计/SSMIS2015组件清单.xlsx</p><p><br/></p><p>如开发时发现文档中缺少方法或服务，则让苏叶挺进行补充。至少内部检查前需要补充完整。</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40b35af36a62015af5927a8d0028', 'root.00002.00003.00008', '40283f81595fd23b01595ff331b50023', '组件使用规范', '组件使用规范', '<p>项目中如有涉及到组件清单中的组件功能，必须使用清单中的组件，严禁个人私自创建。</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5b46321f015b4678bed60001', 'root.00004.00011', '2c9a40b3599542fb015996b3aa070003', 'X—O规范', 'X—O规范', '<p>如遇到X—O选择框的情况，X—O三个值需要使用静态变量中的值，且均为双击循环改变值</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5b46321f015b467b75cf0002', 'root.00004.00012', '2c9a40b3599542fb015996b3aa070003', '左右部分选择功能操作规范', '左右部分选择功能操作规范', '<p>如遇到左右两边选择取消的功能，例如各种多选的选择器，双击左边记录进行选择，双击右边记录进行删除</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5b555c48015b567f70f7000c', 'root.00002.00002.00001.00008', '40283f81595fd23b01595fea02af000d', '禁止使用getViewPath方法', '禁止使用getViewPath方法', '<p>controller中 &nbsp; 避免使用this.getViewPath()方法。直接使用页面所在位置的字符串。例如</p><p>this.setViewPath(&quot;nb/commonComponent/xxxx&quot;);</p><p>return new ModelAndView(this.getViewPath(),model); &nbsp;</p><p><br/></p><p>应直接写成return new ModelAndView(&quot;nb/commonComponent/xxxx&quot;,model);</p><p><br/></p><p>原因：controller中的viewPath变量是共享的（可理解是静态的），多个页面同时访问时容易将A访问的页面返回到B。（A1首页因有众多IFRAME，所以可能两个IFRAME中显示了相同的页面）</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5c13e61f015c15670acc0005', 'root.00004.00013', '2c9a40b3599542fb015996b3aa070003', '数据验证测试', '数据验证测试', '<p>需要保存数据的界面，先不填数据点击保存，检查是否校验，之后将校验未通过的数据项填充正确数据，查看是否验证通过</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5c2da6d2015c3eb4e5840040', 'root.00002.00002.00009', '40283f81595fd23b01595fe9e99e000c', 'Java基础规范', 'Java基础规范', '', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5d05e2e7015d0c6f87fd00aa', 'root.00002.00001.00001.00014', '40283f81595fd23b01595fea2231000e', '页面编写规范', '', '<p></p><p><img src=\"/devil13th/attached/image/20170704/1499152430967-img.png\" title=\"错误.png\" alt=\"错误.png\"/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5d4e2793015d545a1d9e0062', 'root.00002.00005', '40283f81595fd23b01595fe95378000a', 'UI规范', 'UI相关规范', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5d4e2793015d545ab1a00063', 'root.00002.00005.00001', '2c9a40dd5d4e2793015d545a1d9e0062', 'datatables规范', 'datatables规范', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>表头:蓝字不加粗，表头居中<br/></p></li><li><p>文本数据居左，数字居中，日期、字典居中，操作居中</p></li><li><p>表格宽度以数据为准不要过宽或过窄</p></li><li><p>表格字体12像素</p></li><li><p>表格有斑马色条纹，鼠标经过时浅色条纹，鼠标选中后浅蓝色如下图</p><p><img src=\"/devil13th/attached/image/20170718/1500360005547-img.png\" title=\"blob.png\" alt=\"blob.png\"/><br/></p><p><br/></p></li></ol><p><br/></p><p><br/></p><p>代码参考：系统首页工作待办表格</p><p><img src=\"/devil13th/attached/image/20170718/1500359164952-img.png\" title=\"blob.png\" alt=\"blob.png\"/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5d4e2793015d54601fda0069', 'root.00002.00005.00002', '2c9a40dd5d4e2793015d545a1d9e0062', 'FORM相关规范', 'FORM相关规范', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>文本框左右侧对其，如下图</p><p><br/></p><p style=\"text-align:center\"><img src=\"/devil13th/attached/image/20170718/1500359323219-img.png\" title=\"blob.png\" alt=\"blob.png\"/></p></li><li><p>属性名称12像素</p></li><li><p>底部如果有操作按钮，在底部不要随滚动条滚动</p></li></ol><p><br/></p><p>参考界面：建造检验-申请或归档步骤页面</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5d4e2793015d546d8fc5006e', 'root.00002.00005.00003', '2c9a40dd5d4e2793015d545a1d9e0062', '流程中间页面规范', '流程中间页面规范', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>加入标题，且不随滚动条滚动（固定在顶端）<br/></p></li><li><p>页面中底部如存在按钮也不随页面滚动</p></li><li><p>页面背景统一<br/></p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5dc13c35015dc4a36bca0015', 'root.00002.00001.00001.00015', '40283f81595fd23b01595fea2231000e', 'URL不允许传中文参数', 'URL不允许传中文参数', '<p>URL不允许传中文参数，如果必须要使用中文的情况（例如：xxx.do?name=张三），要使用编码2次，解析1次的方式</p><p><br/></p><p>编码例子：</p><p>document.location.href=encodeURI(encodeURI(&#39;${ctx}/bs/BsSysFileManager/downloadTemplate?filePath=nb_assembly_plan.xls&amp;fileName=&#39;+(languageType == &quot;zh_CN&quot;?&#39;分段合拢计划模板&#39;:&#39;assemling-plan-template&#39;)+&#39;.xls&#39;));</p><p><br/></p><p>解码例子：</p><p>&nbsp;后台解析String&nbsp;file_name&nbsp;=&nbsp;&nbsp;URLDecoder.decode(req.getParameter(&quot;fileName&quot;));//生成的名称&nbsp;</p><p><br/></p><p><br/></p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5f6ffb5e015fb2d5437c0183', 'root.00002.00002.00001.00009', '40283f81595fd23b01595fea02af000d', 'BIZ引用规范', 'BIZ引用规范', '<p>为实现服务端与客户端多机分离部署，Controller中只能引用所属当前开发子系统下的DUBBO服务，不可直接引用其他子系统的BIZ</p><p><br/></p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5f6ffb5e015fb420255b01a7', 'root.00002.00002.00004.00001', '40283f81595fd23b01595ff44ced0026', '外部资源、接口地址', '外部资源、接口地址配置方法', '<p>外部资源、接口地址必须写在配置文件cfg.properties中。不允许写在代码中，以下代码是错误的：</p><p><img src=\"/devil13th/attached/image/20171113/1510555660153-img.png\" title=\"image.png\" alt=\"image.png\"/></p><p><br/></p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5f6ffb5e015fb4239ad301a8', 'root.00002.00002.00004.00002', '40283f81595fd23b01595ff44ced0026', 'IOC容器配置规范', 'IOC容器配置规范', '<p style=\"white-space: normal;\">统一检查。检查文件内容、个人分区是否规范。</p><p style=\"white-space: normal;\">例如：不允许随意将IOC中的BEAN随意放置在数据库配置文件中</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5fe16a2c015fe1cac4160001', 'root.00005', '1a', 'A7开发规范', 'A7开发规范', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd5fe16a2c015fe1cb0c000002', 'root.00005.00001.00001', '2c9a40dd5fe16a2c015fe1cac4160001', '代码命名及放置位置', '代码命名及放置位置', '<table cellspacing=\"0\" cellpadding=\"0\"><tbody><tr class=\"firstRow\"><td width=\"122\" valign=\"top\" style=\"border-width: 1px; border-color: windowtext; padding: 0px 7px;\"><p><span style=\"font-family:宋体\">分类</span></p></td><td width=\"155\" valign=\"top\" style=\"border-top-width: 1px; border-right-width: 1px; border-bottom-width: 1px; border-top-color: windowtext; border-right-color: windowtext; border-bottom-color: windowtext; border-left: none; padding: 0px 7px;\"><p><span style=\"font-family:宋体\">描述</span></p></td><td width=\"213\" valign=\"top\" style=\"border-top-width: 1px; border-right-width: 1px; border-bottom-width: 1px; border-top-color: windowtext; border-right-color: windowtext; border-bottom-color: windowtext; border-left: none; padding: 0px 7px;\"><p>Java<span style=\"font-family:宋体\">文件放置位置</span></p></td></tr><tr><td width=\"122\" valign=\"top\" style=\"border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-top: none; padding: 0px 7px;\"><p>A7<span style=\"font-family:宋体\">流程特有功能</span></p></td><td width=\"155\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: windowtext; border-right-width: 1px; border-right-color: windowtext; padding: 0px 7px;\"><p><span style=\"font-family:宋体\">每个流程个性化功能，例如申请、评审等某个流程中特有，非公共的步骤功能</span></p></td><td width=\"213\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: windowtext; border-right-width: 1px; border-right-color: windowtext; padding: 0px 7px;\"><p>Ssmis/ss/controller/[<span style=\"font-family:宋体\">流程名称</span>]Controller.java</p><p>Ssmis/ss/biz/[<span style=\"font-family:宋体\">流程名称</span>]Biz.java</p><p>Ssmis/ss/service/[<span style=\"font-family:宋体\">流程名称</span>]Service.java</p></td></tr><tr><td width=\"122\" valign=\"top\" style=\"border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-top: none; padding: 0px 7px;\"><p>A7<span style=\"font-family:宋体\">流程公共功能组件</span></p></td><td width=\"155\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: windowtext; border-right-width: 1px; border-right-color: windowtext; padding: 0px 7px;\"><p><span style=\"font-family:宋体\">可用于多个流程中，例如证书列表、工作日志、寄送地址等（涉及到多个流程使用，有流程扭转按钮）</span></p></td><td width=\"213\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: windowtext; border-right-width: 1px; border-right-color: windowtext; padding: 0px 7px; word-break: break-all;\"><p>Ssmis/ss/commonController/[<span style=\"font-family:宋体\">功能名称</span>]Controller.java</p><p>Ssmis/ss/commonBiz/[<span style=\"font-family:宋体\">功能名称</span>]Biz.java</p><p>Ssmis/ss/service/[<span style=\"font-family:宋体\">功能名称</span>]Service.java</p></td></tr><tr><td width=\"122\" valign=\"top\" style=\"border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-top: none; padding: 0px 7px;\"><p><span style=\"font-family:宋体\">全系统公共组件（不仅可用于</span>A7<span style=\"font-family:宋体\">）</span></p></td><td width=\"155\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: windowtext; border-right-width: 1px; border-right-color: windowtext; padding: 0px 7px;\"><p><span style=\"font-family:宋体\">常见选择器，例如人员选择器，字典选择器等内容。</span></p></td><td width=\"213\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: windowtext; border-right-width: 1px; border-right-color: windowtext; padding: 0px 7px;\"><p>Ssmis/bs/commonController/[<span style=\"font-family:宋体\">功能名称</span>]Controller.java</p><p>Ssmis/bs/commonBiz/[<span style=\"font-family:宋体\">功能名称</span>]Controller.java</p><p>Ssmis/bs/service/[<span style=\"font-family:宋体\">功能名称</span>]Service.java</p></td></tr><tr><td width=\"122\" valign=\"top\" style=\"border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-top: none; padding: 0px 7px;\"><p><span style=\"font-family:宋体\">全系统公共服务（不仅可用于</span>A7<span style=\"font-family:宋体\">）</span></p></td><td width=\"149\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: windowtext; border-right-width: 1px; border-right-color: windowtext; padding: 0px 7px;\"><p><span style=\"font-family:宋体\">后台接口，例如查询步骤人员，查询人员、查询组织机构，取号，</span>Activities<span style=\"font-family:宋体\">服务等没有界面只有</span>Service<span style=\"font-family:宋体\">的服务接口</span></p></td><td width=\"213\" valign=\"top\" style=\"border-top: none; border-left: none; border-bottom-width: 1px; border-bottom-color: windowtext; border-right-width: 1px; border-right-color: windowtext; padding: 0px 7px;\"><p>Ssmis/bs/service/[<span style=\"font-family:宋体\">功能名称</span>]Service.java</p></td></tr></tbody></table><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b0718016020aee4ab013e', 'root.00005.00001.00002', '2c9a40dd5fe16a2c015fe1cac4160001', '引入流程JS', '', '<p class=\"MsoListParagraph\" style=\"margin-left:28px\">加入公共流程JS &lt;script src=&quot;${ctx}/static/assets/js/pubWorkFlow.js&quot;&gt;&lt;/script&gt;（开发，代码）</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b0718016020afbd92013f', 'root.00005.00001.00003', '2c9a40dd5fe16a2c015fe1cac4160001', '满足表单相关页面的保存方法', '满足表单相关页面的保存方法', '<p class=\"MsoListParagraph\" style=\"margin-left:28px\">查看如果是FORM页面（要使用同步的ajax方法保存），覆盖actWorkFlowObj.isEdited()、actWorkFlowObj.pageValidate()函数和&nbsp;actWorkFlowObj.savePageData()函数</p><p class=\"MsoListParagraph\" style=\"margin-left:28px\"><br/></p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b0718016020b316ac0140', 'root.00005.00001', '2c9a40dd5fe16a2c015fe1cac4160001', '流程功能开发规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b0718016021476f490141', 'root.00005.00002', '2c9a40dd5fe16a2c015fe1cac4160001', '流程功能开发检查项', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b071801602147aca70142', 'root.00005.00002.00001', '2c9a40dd600b0718016021476f490141', '上一步、下一步功能是否正确', '', '<p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\">点击上一步，下一步后是否可以进行扭转，且数据可以正常保存及提示，</span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\"><br/></span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\">操作：</span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\">1.修改页面中某一项数据</span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\">2.点击下一步或上一步按钮</span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\">3.页面会提示数据已修改，是否保存</span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\">4.点击否，页面仍留在当前页面，点击是，流程扭转后关闭界面，刷新代办</span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\"><br/></span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\">验证</span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\">1.是否扭转成功</span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\"><span style=\"font-family: 等线; font-size: 14px;\">2.是否已提示数据已修改，是否。。。。</span></span></span></p><p><span style=\"font-family:等线\"><span style=\"font-size: 14px;\">3.数据是否保存成功</span></span></p><p><br/></p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b071801602148b95a0143', 'root.00005.00002.00002', '2c9a40dd600b0718016021476f490141', 'update方法使用规范', '', '<p>日期或数字类型删除后保存数据后<span style=\"color: rgb(255, 0, 0);\"><strong>重新加载</strong></span>页面后查看删除的数字或日期是否已经被删除</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b071801602149441e0144', 'root.00005.00001.00004', '2c9a40dd600b0718016020b316ac0140', '前台数据展示规范', '', '<p>前台展示的数据，如果数据源为用户输入的内容（包括从数据库中查出的用户曾输入的内容），需要使用&lt;c:out&gt;标签进行输出，不允许使用${}进行输出（放置用户输入的&quot;&gt;等内容直接输出到JSP中导致页面错乱现象发生）。</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b0718016021511d9e0145', 'root.00005.00001.00005', '2c9a40dd600b0718016020b316ac0140', '页面版本检查', '', '<p><span style=\"font-size:14px;font-family:等线\">如果是申请、评审、服务测量表，则检查是否通过版本跳转的界面</span></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b071801602151cc230146', 'root.00005.00002.00003', '2c9a40dd600b0718016021476f490141', '数据权限', '', '<p>地址后面加上ce=0参数后是否均不可编辑</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b071801602483031f0147', 'root.00005.00001.00006', '2c9a40dd600b0718016020b316ac0140', 'URL不允许传递中文', '', '<p>URL不允许传递中文，不允许以GET方式传递中文</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b071801602483b4ab0148', 'root.00005.00001.00007', '2c9a40dd600b0718016020b316ac0140', 'JSON规范', '', '<ol class=\" list-paddingleft-2\" style=\"width: 649.797px; white-space: normal;\"><li><p>非最后一个属性值后面必须加逗号，最后一个属性值后面<span style=\"color: rgb(255, 0, 0);\"><strong>必须</strong></span>不加逗号</p></li></ol><p style=\"white-space: normal;\">例如：</p><p style=\"white-space: normal;\">{</p><p style=\"white-space: normal;\">&quot;name&quot;:&quot;张三&quot;,</p><p style=\"white-space: normal;\">&quot;age&quot;:&quot;5&quot;,</p><p style=\"white-space: normal;\">&quot;birthday&quot;:&quot;2016-01-01&quot; <span style=\"color: rgb(255, 0, 0);\">//最后一个属性最后不加逗号！</span></p><p style=\"white-space: normal;\">}</p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\">2.JSON不允许手工拼写，一律使用Gson工具通过对象转JSON。例如</p><p style=\"white-space: normal;\">Object data = .....;</p><p style=\"white-space: normal;\">GsonBuilder builder = new GsonBuilder();</p><p style=\"white-space: normal;\">Gson gson = builder.create();</p><p style=\"white-space: normal;\">writeJSON(res, gson.toJson(data));</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b071801602484ba0f0149', 'root.00005.00001.00008', '2c9a40dd600b0718016020b316ac0140', '项目根目录规范', '', '<p style=\"white-space: normal;\">必须使用${ctx}代替项目根目录，项目的根目录不允许写死在程序的任何位置</p><p style=\"white-space: normal;\"><br/></p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b0718016024860cd7014a', 'root.00005.00001.00009', '2c9a40dd600b0718016020b316ac0140', '非String类型字段保存规范', '', '<p style=\"white-space: normal;\">场景：编辑非String类型数据，原始数据中有值，清空后保存。</p><p style=\"white-space: normal;\">对于保存非String类型的字段数据，如果使用BaseDao中public void update(Object original,Serializable id,Object[] nullProperties)方法时，要将非String类型字段对应的POJO属性名称放在nullProperties参数中，否则保存不上！</p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\">检查方法：查询更新操作是否能将非字符串的内容清空后保存到数据库中。</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd600b07180160248735b8014b', 'root.00005.00001.00010', '2c9a40dd600b0718016020b316ac0140', '访问路径规范', '', '<p style=\"white-space: normal;\">访问地址，方法名称、返回页面的名称应保持统一（同一个方法返回不同页面时页面名称前缀和方法名保持一致，后缀自定义，前缀和后缀之间使用下划线分隔），参见代码中红色部分</p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\">@RequestMapping(&quot;/<span style=\"color: rgb(255, 0, 0);\">editForm</span>&quot;)</p><p style=\"white-space: normal;\">public ModelAndView&nbsp;<span style=\"color: rgb(255, 0, 0);\">editForm</span>(HttpServletRequest req, HttpServletResponse res, TheForm form) throws Exception {</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>this.getLog().info(&quot;/editForm&quot;);</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span><br/></p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>Map&lt;String, Object&gt; model = new HashMap&lt;String, Object&gt;();</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>try {</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>model.put(&quot;result&quot;, &quot;ERROR&quot;);</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>} catch (Exception e) {</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>e.printStackTrace();</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>this.getLog().info(e);</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>model.put(&quot;result&quot;, &quot;ERROR&quot;);</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>}</p><p style=\"white-space: normal;\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span>return new ModelAndView(&quot;/bs/formManager/<span style=\"color: rgb(255, 0, 0);\">editForm</span>&quot;, model);</p><p style=\"white-space: normal;\">}</p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\">检查方法：检查controller</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd605cecd501606758336b0032', 'root.00006', '1a', '新增子节点', null, null, '1', '1', '1');
INSERT INTO `checklist` VALUES ('2c9a40dd605cecd50160675b9d5d0033', 'root.00005.00002.00004', '2c9a40dd600b0718016021476f490141', '新增子节点', null, null, '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fe8fe440009', 'root.00001', '1a', '数据库规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fe95378000a', 'root.00002', '1a', '开发规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fe9a32b000b', 'root.00002.00001', '40283f81595fd23b01595fe95378000a', '前端', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fe9e99e000c', 'root.00002.00002', '40283f81595fd23b01595fe95378000a', '后端', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fea02af000d', 'root.00002.00002.00001', '40283f81595fd23b01595fe9e99e000c', 'Controller规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fea2231000e', 'root.00002.00001.00001', '40283f81595fd23b01595fe9a32b000b', 'JSP', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fea5b5d000f', 'root.00002.00001.00001.00001', '40283f81595fd23b01595fea2231000e', '页面命名规范', '', '<p>单表CURD的操作，编辑及新增页面命名为 [模块]Form.jsp ,列表页命名为[模块]List.jsp,</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fea98ac0010', 'root.00002.00001.00001.00002', '40283f81595fd23b01595fea2231000e', '引用公共文件规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>必须引入CSS、JS公共引用文件：pubInclude.jsp</p></li><li><p>必须引入公共标签：tagLib.jsp</p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fec46970011', 'root.00002.00002.00001.00001', '40283f81595fd23b01595fea02af000d', '方法定义规范', '', '<p>访问地址，方法名称、返回页面的名称应保持统一（同一个方法返回不同页面时页面名称前缀和方法名保持一致，后缀自定义，前缀和后缀之间使用下划线分隔），参见代码中红色部分</p><p><br/></p><p>@RequestMapping(&quot;/<span style=\"color: rgb(255, 0, 0);\">editForm</span>&quot;)</p><p>public ModelAndView <span style=\"color: rgb(255, 0, 0);\">editForm</span>(HttpServletRequest req, HttpServletResponse res, TheForm form) throws Exception {</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>this.getLog().info(&quot;/editForm&quot;);</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>this.setViewPath(&quot;/bs/formManager/<span style=\"color: rgb(255, 0, 0);\">editForm</span>&quot;);</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>Map&lt;String, Object&gt; model = new HashMap&lt;String, Object&gt;();</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>try {</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>model.put(&quot;result&quot;, &quot;ERROR&quot;);</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>} catch (Exception e) {</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>e.printStackTrace();</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>this.getLog().info(e);</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>model.put(&quot;result&quot;, &quot;ERROR&quot;);</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>}</p><p><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>return new ModelAndView(this.getViewPath(), model);</p><p>}</p><p><br/></p><p>检查方法：检查controller</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fec83250012', 'root.00002.00002.00001.00002', '40283f81595fd23b01595fea02af000d', '方法命名规范', '', '<p>单表CURD的操作，列表页方法名为[模块]List，据的ajax名为[模块]ListGetData，编辑及新增方法名为[模块]Form，列表页获取数</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595feca9410013', 'root.00002.00002.00001.00003', '40283f81595fd23b01595fea02af000d', '方法注释规范', '', '<p>Controller中处理HTTP请求的方法，方法的注释要明确方法描述，访问地址。</p><p>Controller的@RequestMapping注释要写在方法注释的下方</p><p><span style=\"color: rgb(255, 0, 0);\">/**</span></p><p><span style=\"color: rgb(255, 0, 0);\">&nbsp;* 列表获取数据</span></p><p><span style=\"color: rgb(255, 0, 0);\">&nbsp;* /bs/BsDicSurveyKind/bsDicSurveyKindListGetData</span></p><p><span style=\"color: rgb(255, 0, 0);\">&nbsp;*/</span></p><p>@RequestMapping(&quot;/bsDicSurveyKindListGetData&quot;)</p><p>public ModelAndView bsDicSurveyKindListGetData(HttpServletRequest req,HttpServletResponse res,TheForm form) {</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fecf4cc0014', 'root.00002.00002.00001.00004', '40283f81595fd23b01595fea02af000d', '方法运行异常规范', '', '<p>controller中处理请求的方法必须有try catch语句，捕获到的异常要进行处理，不允许将捕获的异常直接展示到前台。</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fed81bf0015', 'root.00002.00001.00001.00003', '40283f81595fd23b01595fea2231000e', 'JSON规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>属性及值必须加入双引号</p></li><li><p>非最后一个属性值后面必须加逗号，最后一个属性值后面<span style=\"color: rgb(255, 0, 0);\"><strong>必须</strong></span>不加逗号</p></li></ol><p>例如：</p><p>{</p><p>&quot;name&quot;:&quot;张三&quot;,</p><p>&quot;age&quot;:&quot;5&quot;,</p><p>&quot;birthday&quot;:&quot;2016-01-01&quot;</p><p>}</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595feda3950016', 'root.00002.00001.00001.00004', '40283f81595fd23b01595fea2231000e', 'JAVASCRIPT对象规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>javascript对象属性必须不使用引号</p></li><li><p>值如果是字符串则使用引号</p></li><li><p>最后一个属性后面必须不加逗号</p><p>例如</p><p>{</p><p>&nbsp; name:&quot;张三&quot;,</p><p>&nbsp; age : 5</p><p>&nbsp; birthday:&quot;2016-01-01&quot;</p><p>&nbsp; books:[&quot;java指南&quot;,&quot;nodejs实战&quot;]</p><p>}</p></li><li><p>数组最后一个元素后不要加引号<br/></p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fede5d70017', 'root.00003', '1a', '测试规范', '', '', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fee44770018', 'root.00001.00001', '40283f81595fd23b01595fe8fe440009', '主键定义规范', '', '<p>每个表只能有一个主键，如果有业务需要则按照业务要求进行命名，如果无业务需要则命名为ID，长度50，备注中必须填写该主键当作为其他表外键时的后缀名称，例如用户表的ID字段如作为其他表的外键则命名为[XXX]_USER_ID（操作人：OPERATOR_USER_ID）。</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fee60460019', 'root.00001.00002', '40283f81595fd23b01595fe8fe440009', '外键定义规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>外键必须按照其所属表的关联表的主键备注中指定的名称作为后缀（参见《主键定义规范》），长度与数据类型与关联表的主键相同。<br/></p></li><li><p>外键备注中需要备注关联的表名，例如 关联USER。</p></li><li><p>为提高数据易维护性，外键在数据库中只作为关联使用，不要进行外键设置。</p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595feebcf6001a', 'root.00001.00003', '40283f81595fd23b01595fe8fe440009', '表及字段定义规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>表名、字段名必须使用大写英文字母</p></li><li><p>表名、字段名要有意义，不得以拼音或拼音首字母命名</p></li><li><p>单词间用下划线“_”进行分割</p></li><li><p>同一模块内的表使用相同前缀并使用下划线“_”进行分割</p></li><li><p>关系表用RELA_开头</p></li><li><p>字典表用DIC开头</p></li><li><p>表及字段必须有备注信息<br/></p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595feee9fb001b', 'root.00001.00004', '40283f81595fd23b01595fe8fe440009', '字段注释规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>所有字段必须有备注</p></li><li><p>如果是固定字典，则将字典值和含义列举出来，例如 字典 是否有效 1：有效 0：无效&nbsp;</p></li><li><p>如果是动态字典，则将字典的标识卸载备注中，例如 字典 附加标志 notation</p></li><li><p>如果是外键，则需指明外键且列出关联表和关联字段，例如 外键 操作人 USER.ID</p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fef2d77001c', 'root.00001.00005', '40283f81595fd23b01595fe8fe440009', '公共字段命名规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>是否有效IS_VALID &nbsp;varchar2(8)| 0无效 1有效</p></li><li><p>创建人CRE_USER_ID&nbsp;varchar2(50)&nbsp;</p></li><li><p>创建时间CRE_TIME date</p></li><li><p>最后修改人MOD_USER_ID&nbsp;&nbsp;varchar2(50)</p></li><li><p>最后修改时间MOD_TIME&nbsp;&nbsp;date</p></li><li><p>是否删除IS_DELETE &nbsp;varchar2(8)&nbsp;| 0已删除 1未删除<br/></p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595fefa888001d', 'root.00002.00002.00002', '40283f81595fd23b01595fe9e99e000c', 'Service规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff0c493001e', 'root.00002.00002.00002.00001', '40283f81595fd23b01595fefa888001d', '方法注释规范', '', '<p style=\"white-space: normal;\">接口方法注释明确标注方法描述、形参名称及含义、返回值的描述。</p><p style=\"white-space: normal;\"><span style=\"color: rgb(255, 0, 0);\">/**</span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(255, 0, 0);\">&nbsp;* 根据树形代码查询节点对象</span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(255, 0, 0);\">&nbsp;* @param code 树形代码</span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(255, 0, 0);\">&nbsp;* @return 节点对象</span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(255, 0, 0);\">&nbsp;*/</span></p><p style=\"white-space: normal;\">public Checklist queryChecklistByCode(String code);</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff0f85b001f', 'root.00002.00002.00002.00002', '40283f81595fd23b01595fefa888001d', '静态字典规范', '', '<p>对于系统中程序中的字典，使用静态变量BsStaticVar中的值，不可混淆使用（例如是否有效的值是0和1，是否删除的值也是0和1，设置有效值的时候不可使用是否删除的值）</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff1feb20020', 'root.00002.00002.00001.00005', '40283f81595fd23b01595fea02af000d', '生成JSON数据规范', '', '<p>JSON不允许手工拼写，一律使用Gson工具通过对象转JSON。例如</p><p>Object data = .....;</p><p>GsonBuilder builder = new GsonBuilder();</p><p>Gson gson = builder.create();</p><p>writeJSON(res, gson.toJson(data));</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff2b8f80021', 'root.00002.00002.00003', '40283f81595fd23b01595fe9e99e000c', '包规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff2e9ed0022', 'root.00002.00002.00003.00001', '40283f81595fd23b01595ff2b8f80021', '包名规范', '', '<p>包名全小写，只允许出现英文字母</p><p>类名驼峰式，只允许出现字母、下划线、数字，且字母开头</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff331b50023', 'root.00002.00003', '40283f81595fd23b01595fe95378000a', '公共规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff388bf0024', 'root.00002.00001.00001.00005', '40283f81595fd23b01595fea2231000e', 'JSP文件位置规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>JSP文件根目录为WEB-INF/pages目录</p></li><li><p>文件要放在所属模块的文件夹下</p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff3cd0e0025', 'root.00002.00001.00001.00006', '40283f81595fd23b01595fea2231000e', 'CSS及JS静态资源引用规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>公共的静态CSS和JS组件必须引用静态资源服务器中的资源</p></li><li><p>静态资源服务器的地址必须使用taglib.jsp中的公共变量</p></li></ol><p><br/></p><p>检查方法：检查每个页面中写的地址内容静态资源地址开头是否带有${ctxStatic}</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff44ced0026', 'root.00002.00002.00004', '40283f81595fd23b01595fe9e99e000c', '配置文件规范', '', '<p>统一检查。检查文件内容、个人分区是否规范。</p><p>例如：不允许随意将IOC中的BEAN随意放置在数据库配置文件中</p><p><br/></p>', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff499250027', 'root.00002.00002.00005', '40283f81595fd23b01595fe9e99e000c', 'SQL编写规范', '', '', '0', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff5c8130028', 'root.00002.00002.00005.00001', '40283f81595fd23b01595ff499250027', '查询语句规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>SQL查询语句字段超过3个（包含）则需要进行SQL格式化，例如：</p><p><br/></p><p style=\"white-space: normal;\">String sql = &quot;select &quot;+</p><p style=\"white-space: normal;\">&quot; t.userName as userName, &quot; + //0 用户名</p><p style=\"white-space: normal;\">&quot; t.userId as id, &quot; + //1 ID</p><p style=\"white-space: normal;\">&quot; t.sex as sex, &quot; + //2 性别</p><p style=\"white-space: normal;\">&quot; t.birthday as bir &quot; + //3 生日</p><p style=\"white-space: normal;\">&quot; from bs_sys_user t where is_delete = ? &quot; &nbsp;</p></li><li><p>如果操作表有删除(is_delete)字段则该字段放在where语句的第一个条件位置，值使用BsStaticVar.DELETE_UNDELTE变量</p></li></ol>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff5f4de0029', 'root.00002.00002.00005.00002', '40283f81595fd23b01595ff499250027', '防SQL注入规范', '', '<p>不允许将前台获取的值拼到SQL语句中。例如：</p><p>错误的写法：&quot; and name like &#39;%&quot; + 张三 + &quot;%&#39;&quot;;</p><p>正确的写法：&quot; and name like ? &quot;;</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff64075002a', 'root.00002.00002.00005.00003', '40283f81595fd23b01595ff499250027', '公共变量规范', '', '<p>数据库中的是否删除和是否有效使用以下静态变量</p><p>BsStaticVar.DELETE_UNDELTE : 未删除</p><p>BsStaticVar.DELETE_DELTE ：已删除</p><p><br/></p><p>BsStaticVar.VALID_VALID：有效</p><p>BsStaticVar.VALID_INVALID：无效</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff69fb6002b', 'root.00002.00001.00001.00007', '40283f81595fd23b01595fea2231000e', 'AJAX使用规范', '', '<p>如果手工编写AJAX程序，则必须使用jquery的$.ajax方法，并定义返回数据的数据格式。例如</p><p>$.ajax({</p><p>&nbsp; &nbsp; dataType: &quot;json&quot;,</p><p>&nbsp; &nbsp; url: &quot;${ctx}/checklist...&quot;,</p><p>&nbsp; &nbsp; success: function(data){</p><p>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"Apple-tab-span\" style=\"white-space:pre\">				</span></p><p>&nbsp; &nbsp; },</p><p>&nbsp; &nbsp; failure:function(data){<br/><br/></p><p>&nbsp; &nbsp; },</p><p>&nbsp; &nbsp; async:false</p><p>});</p><p><br/></p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff6edab002c', 'root.00002.00003.00001', '40283f81595fd23b01595ff331b50023', '关系表处理规范', '', '<p>如操作需要下载到离线版用到的关系表，应记录最后操作时间，且不可物理删除。保持数据的唯一性（删除的数据如果再次添加则修改删除状态及最后操作时间，不可进行物理删除）</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ff7469c002d', 'root.00002.00003.00002', '40283f81595fd23b01595ff331b50023', 'TOMCAT虚拟目录规范', '', '', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81595fd23b01595ffc96b00030', 'root.00002.00003.00003', '40283f81595fd23b01595ff331b50023', '使用静态变量规范', '', '<p>对于系统中程序中的字典，使用静态变量BsStaticVar中的值，不可混淆使用（例如是否有效的值是0和1，是否删除的值也是0和1，设置有效值的时候不可使用是否删除的值）</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81597815bb015979a6f9ca0001', 'root.00002.00001.00001.00008', '40283f81595fd23b01595fea2231000e', '项目跟路径规范', '', '<p>必须使用${ctx}代替项目根目录，项目的根目录不允许写死在程序的任何位置</p><p><br/></p><p>检查方法：检查每个页面中写的地址内容查看地址开头是否带有${ctx}</p>', '1', '1', '1');
INSERT INTO `checklist` VALUES ('40283f81597815bb015979aab5280002', 'root.00002.00001.00001.00009', '40283f81595fd23b01595fea2231000e', '页面引入规范', '', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>被动态(例如c:import)引入的界面不能有HTML、BODY、HEAD标签</p></li><li><p>引入时必须加入字符集设置，例如：<span style=\"color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; line-height: 26px; background-color: rgb(255, 255, 255);\">&lt;c:import &nbsp; url=&quot;${ctx}/templates/a.do&quot; &nbsp;</span><span style=\"font-family: Arial; font-size: 14px; line-height: 26px; color: rgb(255, 0, 0); background-color: rgb(255, 255, 255);\"><span style=\"font-weight: bold;\"><span style=\"font-style: italic;\">charEncoding=&quot;UTF-8&quot;</span>&nbsp;</span></span><span style=\"color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; line-height: 26px; background-color: rgb(255, 255, 255);\">/&gt;</span><br/></p></li></ol><p><br/></p>', '1', '1', '1');
