INSERT INTO `se_proc_task` VALUES ('2017TASK00020', '预读需求设计', '2c9a40dd5cc9cb4e015cd3e9dfc40040', 'lwang', '<p>预读需求设计</p><ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>预读时，需思考开发实现时是否有问题</p></li><li><p>规避文档中二义性内容</p></li><li><p>预读后复述给设计人员打成共识，</p></li><li><p>预读需求设计时，将问题登录在本系统需求矩阵-遗留备忘中，并将问题分类设置为设计缺陷</p></li></ol>', '', '', null, 'SSMIS-A5');
