INSERT INTO `se_proc_task` VALUES ('2017TASK00034', '建造批量派工后台人员组设置', '2c9a40dd5cae4a13015cb038e4ea0074', 'lwang', '<p><strong><strong style=\"color: rgb(255, 0, 0); white-space: normal;\">注：本周三前务必完成此功能模块开发</strong></strong></p><p><strong><br/></strong></p><p><strong>所用系统表：</strong></p><p>&nbsp;NB_DIC_WORKGROP;&nbsp;NB_DIC_WORKGROP_USER;&nbsp;</p><p><strong>文档svn位置：</strong></p><p>&nbsp;http://svn.ccsit.cn/2016/A6建造/Development_Library/05设计文档/07 需求设计基线/B0002/06 设计文档/画面详细设计/建造检验流程/SSMIS2015A6设计说明书-SNB038工作组管理.xlsx</p><p><br/></p><p><br/></p>', '', '', null, 'SSMIS-A6');
INSERT INTO `se_proc_task` VALUES ('2017TASK00035', '对A6的系统国际化工作进行总结，上传A6的SVN开发目录下，具体问题参见任务要求', '2c9a40dd5d05e2e7015d062708bb0003', 'lwang', '<p>总结内容应包含如下内容：</p><ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>国际化的几种场景及代码要求</p></li><li><p>整理国际化（重复，缺少）的方法</p></li><li><p>形成文档后上传上传A6的SVN开发目录下和本系统<br/></p></li></ol>', '', '', null, 'SSMIS-A6');
INSERT INTO `se_proc_task` VALUES ('2017TASK00036', 'FORM批量开发', '2c9a40dd5dbf47bc015dbf7341310003', 'lwang', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>与本月9日前将整理A5的所有方式的输入输出的代码以供开发人员使用；</p></li><li><p>培训于泽福昕插件输入（新人新事，培训需仔细）；</p></li><li><p>培训沙长伟PDF模板输出方式（之前已做过）；</p></li><li><p>人员分配建议如下：</p><p>FORM开发总体负责及技术研究：李帅飞</p><p>福昕插件FORM输入：于泽</p><p>PDF模板输出：沙长伟</p><p>非固定模板输入与输出：李帅飞，苏文忠</p><p><br/></p></li></ol>', '', '', null, 'SSMIS-A5');
INSERT INTO `se_proc_task` VALUES ('2017TASK00037', '将A5的国际化文件拆分，具体内容参见任务要求', '2c9a40dd5dbf47bc015dbfa9dcc20030', 'lwang', '<p>将A5的国际化文件拆分，原则为区分开大连A5国际化文件和数码易知A5国际化文件，大连方的国际化文件名保持现状，数码易知国际化文件名加入_ccse后缀。</p>', '', '', null, 'SSMIS-A5');
INSERT INTO `se_proc_task` VALUES ('2017TASK00038', 'FORM批量开发', '2c9a40dd5dbf47bc015dbf7341310003', 'lwang', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>汇总FORM开发EXCEL ， 位置SVN：A5产品\\Development_Library\\06开发文档\\FORM相关 ,建立FORM集合</p></li><li><p>找出可用的ps_form.work_id,所有FORM开发人员使用相同的work_id</p></li><li><p>开发建立的测试数据要求（bs_dic_form,bs_dic_form_version,ps_form）：a.FORM字典选择产品，b.ps_form表使用相同的work_id</p></li><li><p>找郭存要模板（尽快）</p></li><li><p>研究非固定模板开发方式，并出实例代码</p></li></ol>', '', '', null, 'SSMIS-A5');
INSERT INTO `se_proc_task` VALUES ('2017TASK00039', '在A5FORM测试界面中加入 FORM输出按钮并实现功能', '2c9a40dd5d772c54015d78c768c10036', 'lwang', '<p>在A5FORM测试界面中加入 FORM输出按钮并实现功能。输出后还用福昕插件显示生成的PDF即可<img src=\"/devil13th/attached/image/20170814/1502699031481-img.png\" title=\"blob.png\" alt=\"blob.png\"/></p>', '<p>已完成</p>', '', null, 'SSMIS-A5');
