INSERT INTO `se_proc_task` VALUES ('2017TASK00054', '日常事务', '2c9a40dd5d15d13b015d29eb1f4000d8', 'lwang', '<ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>EFORM报价</p></li><li><p>A5FORM问题修改</p></li><li><p>咨询赵永刚什么时候可以测试完成，大连的问题直接发送大连方，我们的问题直接跟徐洁沟通</p></li><li><p>A4-FORM本周开发内容</p></li></ol><p>a.周青俊汇总FORM清单及模板</p><p>b.分析及派工</p><p><br/></p><p>5.汇总A4每个人手中的任务还有那些</p>', '<ol class=\" list-paddingleft-2\" style=\"width: 909.141px; white-space: normal;\"><li><p>EFORM报价&nbsp;<img src=\"http://172.26.192.93:8090/devil13th/js/ueditor/dialogs/attachment/fileTypeImages/icon_txt.gif\" style=\"vertical-align: middle; margin-right: 2px;\"/><a href=\"/devil13th/attached/image/20171030/1509359353678-img.xlsx\" title=\"AllForm20170915-V01.2-汇总.xlsx\" style=\"font-size: 12px; color: rgb(0, 102, 204);\">AllForm20170915-V01.2-汇总.xlsx</a></p></li><li><p>A5FORM问题修改</p></li><li><p>咨询赵永刚什么时候可以测试完成，大连的问题直接发送大连方，我们的问题直接跟徐洁沟通</p></li><li><p>A4-FORM本周开发内容</p></li></ol><p style=\"white-space: normal;\">a.周青俊汇总FORM清单及模板</p><p style=\"white-space: normal;\">b.分析及派工</p><p style=\"white-space: normal;\"><span style=\"text-decoration: line-through;\">5.汇总A4每个人手中的任务还有那些</span></p><p style=\"white-space: normal;\"><span style=\"text-decoration: none;\">徐洁：</span>1.A6测试问题随时进行修改&nbsp; 2.修改A4测试BUG</p><p style=\"white-space: normal;\"><span style=\"text-decoration: line-through;\"></span>于泽：产品审图收尾（1天）修改A4测试BUG</p><p style=\"white-space: normal;\">李帅飞：修改A4测试BUG</p><p style=\"white-space: normal;\">商雷博：<span style=\"text-decoration: line-through;\">吨位计算导入（1天） </span>修改A4测试BUG</p><p style=\"white-space: normal;\">王磊：EFORM报价估算（0.5天）&nbsp; 修改图纸编辑界面（0.2天） 准备部署A5系统的事</p><p style=\"white-space: normal;\">苏文忠：修改A5辛姐测试出来的FORM问题（0.5天）&nbsp; 来函登记（1天）</p>', '', null, 'SSMIS-A5');
INSERT INTO `se_proc_task` VALUES ('2017TASK00055', '2017.11.6周个人工作计划', '2c9a40dd5e16e9ea015e18bbca300051', 'lwang', '<p>2017.11.6日工作计划</p><ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>FORM-证书预算，今天必须弄完<br/></p></li><li><p>考虑FORM开发如何管理 （代码管理岗，质量控制岗，开发绩效审查岗，工作流程）</p></li><li><p>A4子系统26个声明信岗</p></li><li><p>联合调试客户端版</p><p><br/></p><p><br/></p></li></ol><p><br/></p><p>2017.11.7日工作计划<br/></p><ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>考虑记录开发如何估算工时，如何开展工作</p></li></ol><p><br/></p>', '<p style=\"white-space: normal;\">2017.11.6日工作计划</p><ol class=\" list-paddingleft-2\" style=\"width: 893px; white-space: normal;\"><li><p>FORM-证书预算，今天必须弄完 - 已完成&nbsp;&nbsp;<img src=\"http://172.26.192.93:8090/devil13th/js/ueditor/dialogs/attachment/fileTypeImages/icon_txt.gif\" style=\"vertical-align: middle; margin-right: 2px;\"/><a href=\"/devil13th/attached/image/20171106/1509934593989-img.xlsx\" title=\"AllForm20170915-V01.2-汇总_离线改.xlsx\" style=\"font-size: 12px; color: rgb(0, 102, 204);\">AllForm20170915-V01.2-汇总_离线改.xlsx</a></p></li><li><p>考虑FORM开发如何管理 （代码管理岗，质量控制岗，开发绩效审查岗，工作流程）</p></li><li><p>A4子系统26个声明信岗</p></li><li><p>联合调试客户端版</p></li><li><p>A6子系统回归测试问题<br/></p></li><li><p>汇总每个人手中的工作，安排本周工作<br/></p><p>王磊：参见计划</p><p>徐洁：问题修改</p><p>李帅飞：FORM - 除申请书还有5个（大约3天内完成），</p><p>沙长伟：FORM - 还有7个（1天内完成-有一个没有模板需要1天，总计两天）</p><p>苏文忠：A5的FORM修改</p><p>于泽：声明信编辑界面</p><p>商雷博：EEDI两个功能</p><p><br/></p><p><br/></p><p>待开发任务：1.客户端版联调（商雷博）&nbsp; 2.申请书（汇总BEAN，模板开发，集成 三步分开）&nbsp; 3.智能匹配证书和建造标准（先写SQL再写规则）&nbsp; 4.测试问题修改&nbsp; 5.服务接口开发</p></li></ol><p style=\"white-space: normal;\">&nbsp;</p><p style=\"white-space: normal;\">2017.11.7日工作计划<br/></p><ol class=\" list-paddingleft-2\" style=\"width: 893px; white-space: normal;\"><li><p>考虑记录开发如何估算工时，如何开展工作</p></li></ol><p><br/></p>', '', null, 'SSMIS-A4');
